	add("metamorphism", "{\"term\":\"metamorphism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From {{suffix|metamorphosis|ism|lang\u003den}}, after French \u0027métamorphisme\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process by which rocks are changed into other forms by the application of heat and/or pressure\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Richard Fortey, \u0027The Earth\u0027, Folio Society 2011, p. 100\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"burial means that the ambient pressure on the rock increases – as does the temperature. This encourages \u0027\u0027metamorphism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The process by which insects development through life stages -- as, for example, those of embryo, larva, pupa and imago. The life cycle of the butterfly is one of complete metamorphosis, in which the embryo grows within the egg, hatches into the larval stage caterpillar, enters the pupal stage within its chrysalis, and finally emerges as an adult butterfly imago\", \"priority\":4}]}, \"synonyms\":{}}");

	add("metamour", "{\"term\":\"metamour\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|amour|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In a polyamorous relationship, one\u0027s partner\u0027s partner, with whom one is not directly involved\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metanalysis", "{\"term\":\"metanalysis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|analysis|lang\u003den}}, coined by w:Otto Jesperson|Otto Jesperson.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Analysis of analyses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027metanalysis\u0027\u0027 of 35 existing studies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of breaking down a word or phrase into segments or meanings not original to it; breaking down the boundaries between words or other units\", \"priority\":3}]}, \"synonyms\":{}}");

