	add("metaphor", "{\"term\":\"metaphor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027métaphore\u0027 from Latin \u0027metaphora\u0027 from Ancient greek (to 1453) \u0027μεταφορά\u0027 from \u0027μεταφέρω\u0027 (i transfer, apply) from \u0027μετά\u0027 (with, across, after) + \u0027φέρω\u0027 (i bear, carry)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of a word or phrase to refer to something that it isn’t, invoking a direct similarity between the word or phrase used and the thing described, but in the case of English without the words \u0027like\u0027 or \u0027as\u0027, which would imply a simile\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A Metaphor may be changed into a Simile...\u0026lt;br\u0026gt;Metaphor. - Idleness is the rust of the soul\u0026lt;br\u0026gt;Simile. - As rust is to iron, so is idleness to the soul...\u0027\u0026lt;br\u0026gt; \u0026amp;mdash; John Seely Hart, \u0027[https://books.google.se/books?hl\u003den\u0026amp;lr\u003d\u0026amp;id\u003dN_1JAAAAIAAJ\u0026amp;oi\u003dfnd\u0026amp;pg\u003dPA9 First Lessons in Composition]\u0027, 187\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"What then is truth? A movable host of \u0027\u0027metaphors\u0027\u0027, metonymies, and; anthropomorphisms: in short, a sum of human relations which have been poetically and rhetorically intensified, transferred, and embellished, and which, after long usage, seem to a people to be fixed, canonical, and binding. Truths are illusions which we have forgotten are illusions \u0026amp;mdash; they are \u0027\u0027metaphors\u0027\u0027 that have become worn out and have been drained of sensuous force, coins which have lost their embossing and are now considered as metal and no longer as coins.\u0027 \u0026amp;mdash; Friedrich Nietzsche, \u0027On Truth and Lies in a Nonmoral Sense\u0027, 1870, translated by Daniel Beazeale, 1979\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The word or phrase used in this way. An implied comparison\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The use of an everyday object or concept to represent an underlying facet of the computer and thus aid users in performing tasks\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"desktop \u0027\u0027metaphor\u0027\u0027; wastebasket \u0027\u0027metaphor\", \"priority\":6}]}, \"synonyms\":{}}");

