	add("metaprogram", "{\"term\":\"metaprogram\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|program|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"neurolinguistic programming\u0027) A thinking pattern which determines what information a person takes note of and what information they screen out\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A computer program that writes or manipulates other programs as data, or does the work at runtime that would otherwise be done at compile time\", \"priority\":2}]}, \"synonyms\":{}}");

