	add("metaracism", "{\"term\":\"metaracism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|racism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A relatively modern form of racism, asserting that the insurmountable differences between races are not primarily biological but primarily cultural\", \"priority\":1}]}, \"synonyms\":{}}");

