	add("metarepresentation", "{\"term\":\"metarepresentation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|representation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A representation of a representation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metarteriole", "{\"term\":\"metarteriole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|arteriole|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An arterial capillary; a short vessel linking arterioles and venules\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metarule", "{\"term\":\"metarule\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|rule|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rule that governs the application of other rules\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The existence and durability of social rules—irrespective of\u0026lt;br\u0026gt; the sources to which man may have attributed them—is evi-\u0026lt;br\u0026gt; dence of the intensity of the human need to follow rules.\u0026lt;br\u0026gt; Indeed, man\u0027s need for rules and his propensity to follow them\u0026lt;br\u0026gt; is equaled only by his desire to reject rules and be free of\u0026lt;br\u0026gt; them. As I will try to show later,\u0026lt;sup\u0026gt;\u0026lt;small\u0026gt;15\u0026lt;/small\u0026gt;\u0026lt;/sup\u0026gt; this antithetical disposition\u0026lt;br\u0026gt; is a special instance of a more general human ambivalence—\u0026lt;br\u0026gt; namely, the simultaneous needs for intimacy and solitude.\u0026lt;br\u0026gt; Alternating attitudes of submission to and rebellion against\u0026lt;br\u0026gt; people and rules may be best viewed as manifestations of this\u0026lt;br\u0026gt; fundamental human paradox. One of the most useful methods\u0026lt;br\u0026gt; for resolving this dilemma is our capacity for abstraction\u0026lt;br\u0026gt; which makes it possible to construct progressively higher\u0026lt;br\u0026gt; levels of symbolization; these constructs, in turn, lead to a\u0026lt;br\u0026gt; lessening of the feeling of compulsion attached to rules explic-\u0026lt;br\u0026gt; itly understood as rules. Thus, for each set of rules we can, in\u0026lt;br\u0026gt; principle, construct a set of \u0027\u0027metarules\u0027\u0027. The latter are made up\u0026lt;br\u0026gt; of the specifications governing the formation of the rules at the\u0026lt;br\u0026gt; next lower (logical) level. Explicit awareness of \u0027\u0027metarules\u0027\u0027\u0026lt;br\u0026gt; implies an understanding of the origin, function, and scope of\u0026lt;br\u0026gt; the (next lower level) rules. Acquiring such understanding\u0026lt;br\u0026gt; constitutes a form of mastery. Only by practicing what may be\u0026lt;br\u0026gt; called the \u0027\u0027metarule\u0027\u0027 attitude—which is actually a special case\u0026lt;br\u0026gt; of the scientific attitude applied to the domain of rules—can\u0026lt;br\u0026gt; we acquire a secure yet flexible integration of rules as behav-\u0026lt;br\u0026gt; ior-regulating agencies. Finally, the \u0027\u0027metarule\u0027\u0027 attitude enables\u0026lt;br\u0026gt; us to increase our range of choices about whether or not to\u0026lt;br\u0026gt; comply with rules, and whether or not to try to change them\", \"priority\":2}]}, \"synonyms\":{}}");

