	add("metastability", "{\"term\":\"metastability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|stability|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unstable but potentially long-lived state of a system; for example, a supersaturated solution or an excited atom\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Irving Singer \u0027The Nature of Love\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Soloman\u0027s belief that love is necessarily paradoxical issues from his attempt to define it as what Sartre would call a dialectical \u0027\u0027metastability\u0027\u0027. Love must therefore be not a \u0026quot;state of the union but a never ending conflict of pushing away and pulling together.\u0026quot;\u0026lt\", \"priority\":3}]}, \"synonyms\":{}}");

	add("metastasis", "{\"term\":\"metastasis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From from Ancient greek (to 1453) \u0027μετάστασις\u0027 (lang\u003dgrc) from \u0027μεθίστημι\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The transference of a bodily function or disease to another part of the body, specifically the development of a secondary area of disease remote from the original site, as with some cancers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1963: Thomas Pynchon, \u0027V\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Stayed in her own house, searched her body each morning and examined her conscience each night for progressive symptoms of the \u0027\u0027metastasis\u0027\u0027 she feared was in her\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The spread of a harmful event to another location, like the metastasis of a cancer\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Denying adversaries\u0027 arguments and turning the arguments back on them\", \"priority\":5}]}, \"synonyms\":{}}");

	add("metastrategy", "{\"term\":\"metastrategy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|strategy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An overarching strategy determining which other strategies to use in a given situation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metastring", "{\"term\":\"metastring\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|string|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A string of characters used as a placeholder for a variable data item\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The $D \u0027\u0027metastring\u0027\u0027 expands to the current date and time\", \"priority\":2}]}, \"synonyms\":{}}");

	add("metastyle", "{\"term\":\"metastyle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|meta|style|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very long styl\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A ridge, covered with enamel, on the outer side of a molar tooth in animals such as the horse\", \"priority\":2}]}, \"synonyms\":{}}");

	add("metastyrol", "{\"term\":\"metastyrol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|styrol|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Polystyrene\", \"priority\":1}]}, \"synonyms\":{}}");

