	add("metathesis", "{\"term\":\"metathesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027metathesis\u0027 from Ancient greek (to 1453) \u0027μετάθεσις\u0027 from \u0027μετά\u0027 (among) + \u0027θέσις\u0027 (placement)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The transposition of letters, syllables or sounds within a word, such as in \u0027ask\u0027 as /æks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The double decomposition of inorganic salts\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The breaking and reforming of double bonds in olefins in which substituent groups are swapped\", \"priority\":3}]}, \"synonyms\":{}}");

	add("metathinking", "{\"term\":\"metathinking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|thinking|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Thought about the process of thinking\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metathought", "{\"term\":\"metathought\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|thought|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Thought about thought itself\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metatranscriptomics", "{\"term\":\"metatranscriptomics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A branch of transcriptomics that studies, and correlates, the transcriptomes of a group of interacting organisms or species\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metatungstate", "{\"term\":\"metatungstate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|tungstate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any tungstate that contains multiple atoms of tungsten e.g. W\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt;O\u0026lt;sub\u0026gt;13\u0026lt;/sub\u0026gt;\u0026lt;sup\u0026gt;2-\u0026lt;/sup\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metatypy", "{\"term\":\"metatypy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by w:Malcolm Ross|Malcolm Ross in 1996.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The morphosyntactic change a language undergoes due to its speakers being bilingual in another languag\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metaverse", "{\"term\":\"metaverse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|meta|universe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of universes, or the composite of all universes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Ervin Laszlo, \u0027The Connectivity Hypothesis\u0027, page 108\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A single-cycle universe comes to eternal rest. But further instabilities in the virtual energy domain may occur, and some of these may be potent enough to create new universes. The thesis of a \u0027\u0027metaverse\u0027\u0027 giving rise to local universes is cogent\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A hypothetical future (counterpart or continuation of the) Internet, created by the convergence of virtually enhanced physical reality and physically persistent virtual space\", \"priority\":4}]}, \"synonyms\":{}}");

	add("metayage", "{\"term\":\"metayage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"French \u0027métayage\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind of sharecropping system\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metazeunerite", "{\"term\":\"metazeunerite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|meta|zeunerite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tetragonal-dipyramidal mineral containing arsenic, copper, hydrogen, oxygen, and uranium\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metazoa", "{\"term\":\"metazoa\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"All those multicellular animals of the subkingdom Metazoa\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metazoan", "{\"term\":\"metazoan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Metazoa|an|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any animal that undergoes development from an embryo stage with three tissue layers, namely the ectoderm, mesoderm, and endoderm. The term applies to all animals except the sponges\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any animal that is multicellular\", \"priority\":2}]}, \"synonyms\":{}}");

	add("meter", "{\"term\":\"meter\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027mètre\u0027 from Ancient greek (to 1453) \u0027μέτρον\u0027 (measure)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"always\u0027 \u0027\u0027meter\u0027\u0027) A device that measures things\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"always\u0027 \u0027\u0027meter\u0027\u0027) A parking meter or similar device for collecting payment\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"gas \u0027\u0027meter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"always\u0027 \u0027\u0027meter\u0027\u0027) One who metes or measures\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The base unit of length in the International System of Units (SI), conceived of as 1/10000000 of the distance from the North Pole to the Equator, and now defined as the distance light will travel in a vacuum in 1/299792458 second\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dEarless ghost swift moths become “invisible” to echolocating bats by forming mating clusters close (less than half a \u0027\u0027meter\u0027\u0027) above vegetation and effectively blending into the clutter of echoes that the bat receives from the leaves and stems around them\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An increment of music; the overall rhythm; particularly, the number of beats in a measure\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The rhythm pattern in a poem\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A line above or below a hanging net, to which the net is attached in order to strengthen it\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A poem\", \"priority\":10}]}, \"synonyms\":{}}");

	add("metemorphothe", "{\"term\":\"metemorphothe\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{etystub|en}} From Ancient greek (to 1453)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Transfiguration of Christ\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metempsychosis", "{\"term\":\"metempsychosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027metempsychosis\u0027 from Hellenistic Ancient greek (to 1453) \u0027μετεμψύχωσις\u0027 from Ancient greek (to 1453) \u0027μετα-\u0027 + \u0027εν\u0027 (in) + \u0027ψυχή\u0027 (soul)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Transmigration of the soul, especially its reincarnation after death\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.11\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Pythagoras\u0027 borrowed \u0027\u0027\u0027Metempsychosis\u0027\u0027\u0027 of the Ægyptians, but since, it hath been received of divers Nations, and especially of our \u0027Druides\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027, \u0026quot;The Finest Story in the World\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Fates that are so careful to shut the doors of each successive life behind us had, in this case, been neglectful, and Charlie was looking, though that he did not know, where never man had been permitted to look with full knowledge since Time began. Above all he was absolutely ignorant of the knowledge sold to me for five pounds; and he would retain that ignorance, for bank-clerks do not understand \u0027\u0027metempsychosis\u0027\u0027, and a sound commercial education does not include Greek\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, \u0027w:Ulysses Ulysses\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Metempsychosis\u0027\u0027, he said, is what the ancient Greeks called it. They used to believe you could be changed into an animal or a tree, for instance. What they called nymphs, for example\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"To go along assuming that Victoria the girl tourist and Veronica the sewer rat were one and the same V. was not at all to bring up any \u0027\u0027metempsychosis\u0027\u0027: only to affirm that his quarry fitted in with The Big One, the century’s master cabal\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Hers was a \u0027\u0027metempsychosis\u0027\u0027 of novelty, her mind a vapid thing until animated by the next absolute conviction\", \"priority\":9}]}, \"synonyms\":{}}");

	add("metemptosis", "{\"term\":\"metemptosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027μετά\u0027 (beyond) + \u0027ἐν\u0027 (in) + \u0027πτωτός\u0027 (fallen)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The suppression of a day in the calendar to prevent the date of the new moon being set a day too late, or the suppression of the bissextile day once in 134 years\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metenkephalin", "{\"term\":\"metenkephalin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|Met|enkephalin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An endogenous opioid peptide neurotransmitter found naturally in many parts of the animal and human body; one of the two forms of enkephalin (the other being leuenkephalin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("meteor", "{\"term\":\"meteor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027météore\u0027 from Old french (842-ca. 1400) from Latin \u0027meteorum\u0027 from Ancient greek (to 1453) \u0027μετέωρον\u0027 from \u0027μετέωρος\u0027 (raised from the ground, hanging, lofty) from \u0027μετά\u0027 (in the midst of, among, between) (English \u0027meta\u0027 + \u0027ἀείρω\u0027 (to lift, to heave, to raise up) Original sense of “atmospheric phenomenon” gave rise to \u0027meteorology\u0027 now restricted to extraterrestrial objects burning up as they enter the atmosphere.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any atmospheric phenomenon. (Thus the derivation of \u0027meteorology.\u0027) These were sometimes classified as \u0027aerial\u0027 or \u0027airy\u0027 meteors (winds), \u0027aqueous\u0027 or \u0027watery\u0027 meteors (hydrometeors: clouds, rain, snow, hail, dew, frost), \u0027luminous\u0027 meteors (rainbows and aurora), and \u0027igneous\u0027 or \u0027fiery\u0027 meteors (lightning and shooting stars [next\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fast-moving streak of light in the night sky caused by the entry of extraterrestrial matter into the earth\u0027s atmosphere: A shooting star or falling star\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A prop similar to \u0027poi balls\u0027, in that it is twirled at the end of a cord or cable\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A striking weapon resembling a track and field hammer hammer consisting of a weight swung at the end of a cable or chain\", \"priority\":4}]}, \"synonyms\":{}}");

	add("meteorite", "{\"term\":\"meteorite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|meteor|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A metallic or stony object or body that is the remains of a meteor\", \"priority\":1}]}, \"synonyms\":{}}");

	add("meteoritics", "{\"term\":\"meteoritics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|meteor|ite|ics|lang\u003den}} ({{suffix|meteorite|ics|lang\u003den}})\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A science that deals with meteors and meteorites\", \"priority\":1}]}, \"synonyms\":{}}");

	add("meteoroid", "{\"term\":\"meteoroid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|meteor|oid|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A relatively small (sand- to boulder-sized) fragment of debris in a solar system that produces a meteor when it hits the atmosphere\", \"priority\":1}]}, \"synonyms\":{}}");

	add("meteorology", "{\"term\":\"meteorology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"{{defdate|1610}} From French \u0027météorologie\u0027 from Ancient greek (to 1453) \u0027μετέωρος\u0027 (lang\u003dgrc) + {{m|grc|-λογία}}. Surface etymology is {{suffix|meteor|t1\u003datmospheric phenomenon|logy|t2\u003dstudy of|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The science that deals with the study of the atmosphere and its phenomena, especially with weather and weather forecasting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The atmospheric phenomena in a specific region or period\", \"priority\":2}]}, \"synonyms\":{}}");

	add("meteoromancy", "{\"term\":\"meteoromancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) {{m|grc|μετέωρος||in mid-air}} {{suffix||mancy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Divination by interpreting meteorological phenomena such as meteors\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1855\u0027\u0027 Elihu Rich in Smedley et al. Occult Sci\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Romans are believed to have derived \u0027\u0027meteoromancy\u0027\u0027 from Etruria\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027 Gibson Complete Illust. Bk Div. \u0026amp; Prophec\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"METEOROMANCY\u0027\u0027: A special branch of astromancy dealing with omens that pertain to shooting stars. Ancient Roman augurs included thunder, lightning, eclipses, and other heavenly phenomena in such divinations\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027 Complete Bk Prediction\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Meteoromancy\u0027\u0027: Divination from meteors and shooting stars\", \"priority\":7}]}, \"synonyms\":{}}");

	add("meteoropathy", "{\"term\":\"meteoropathy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|meteoro|pathy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A physical condition or symptom associated with weather conditions, such as humidity or temperature\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metformin", "{\"term\":\"metformin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Category:en:DrugsA popular oral drug for the treatment of diabetes, having the chemical formula C\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;11\u0026lt;/sub\u0026gt;N\u0026lt;sub\u0026gt;5\u0026lt;/sub\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methi", "{\"term\":\"methi\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}{{rfp|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In Indian cooking, fenugreek\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Sanjeev Kapoor, \u0027Khazana of Healthy Tasty Recipes\u0027 (page 68\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Immediately, add the chopped \u0027\u0027methi\u0027\u0027 leaves and cook on medium heat, stirring frequently for six to eight minutes, stirring continuously or until the methi leaves are completely cooked and dry\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Robert Sietsema, \u0027The Food Lover\u0027s Guide to the Best Ethnic Eating in New York City\u0027 (page 264\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Skip the free Russian-leaning appetizer salads, which are uniformly awful, and dive into a menu that includes excellent chicken \u0027\u0027methi\u0027\u0027 and the tangy stewed mustard greens called sarsoka sag\", \"priority\":5}]}, \"synonyms\":{}}");

	add("metho", "{\"term\":\"metho\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|methylated spirits|o|gloss2\u003ddiminutive suffix|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"methylated Methylated spirits\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Living Australia, photograph caption, \u0027Dangerous Australians: The Complete Guide to Australia\u0027s Most Deadly Creatures\u0027, [http://books.google.com.au/books?id\u003d_w5lo2j4zBQC\u0026amp;pg\u003dPA61\u0026amp;dq\u003d%22metho%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dfWeuT4jVMMX0mAWN5JylCQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22metho%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 61\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Ben Cropp, aided by his wife Lynn, tests the effectiveness of \u0027\u0027metho\u0027\u0027 and vinegar against box jellyfish stings (above); see Ben′s foreword for details of the experiment\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, w:Kate Kate Jennings, \u0027Cold Water\u0027, \u0027Save Me, Joe Louis\u0027, reprinted 2010, \u0027Trouble: Evolution of a Radical, Selected Writings 1970-2010\u0027, [http://books.google.com.au/books?id\u003dAOEUwVRzqUoC\u0026amp;pg\u003dPA78\u0026amp;dq\u003d%22metho%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dfWeuT4jVMMX0mAWN5JylCQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22metho%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 78\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"We thought an alcoholic was a low life, someone on \u0027\u0027metho\u0027\u0027, or a benighted person who drank a bottle of gin before breakfast. Not us\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Curriculum Corporation (Australia), \u0027From Igloos to Yurts: Years 4-7\u0027, [http://books.google.com.au/books?id\u003dlSYus5FtsjAC\u0026amp;pg\u003dPA23\u0026amp;dq\u003d%22metho%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dfWeuT4jVMMX0mAWN5JylCQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dfalse page 23\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Assist students to design and construct models of hot-air balloons ranging from those using shopping bags and hair dryers, to those using tissue paper and \u0027\u0027metho\u0027\u0027 burners, depending on the resources available\", \"priority\":10}]}, \"synonyms\":{}}");

	add("methacrolein", "{\"term\":\"methacrolein\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a clear, colorless, flammable liquid, molecular formula C\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;6\u0026lt;/sub\u0026gt;O\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methadone", "{\"term\":\"methadone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A synthetic opioid analgesic, used to wean addicts off of heroin or other opiate based narcotics, and in chronic pain management\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methamidophos", "{\"term\":\"methamidophos\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A specific organophosphate insecticide, having the chemical formula C2H8NO2P\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methamine", "{\"term\":\"methamine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|meth|amine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Hexamine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methandrostenolone", "{\"term\":\"methandrostenolone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An orally-effective anabolic steroid formerly used as a muscle growth aid by bodybuilders\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methane", "{\"term\":\"methane\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027methyl\u0027 () + \u0027-ane\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The simplest aliphatic hydrocarbon, CH\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt;, being a constituent of natural gas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Cattle emit a large amount of \u0027\u0027methane\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of very many derivatives of methane\", \"priority\":3}]}, \"synonyms\":{}}");

	add("methanesulfonamide", "{\"term\":\"methanesulfonamide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The sulfonamide of methanesulfonic acid, CH\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;SO\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;NH\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;, used as an intermediate in the synthesis of pharmaceuticals etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methanogenesis", "{\"term\":\"methanogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|methane|genesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The generation of methane by anaerobic bacteria\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methanotrophy", "{\"term\":\"methanotrophy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The bacterial use of methane as a source of carbon and of energy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methenolone", "{\"term\":\"methenolone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A long acting anabolic steroid with limited androgenic properties, having the chemical formula C\u0026lt;sub\u0026gt;20\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;30\u0026lt;/sub\u0026gt;O\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methexis", "{\"term\":\"methexis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027μέθεξις\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An originally Ancient Greek form of theatre in which the audience participates and improvises\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The relation between a particular and a Platonic form\", \"priority\":2}]}, \"synonyms\":{}}");

	add("methicillin", "{\"term\":\"methicillin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|methi-|-cilin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An antibiotic drug, chemically related to penicillin, often used against strains of bacteria which have become resistant to penicillin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methiocarb", "{\"term\":\"methiocarb\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A carcinogenic neurotoxin used as an insecticide and bird repellent\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methionine", "{\"term\":\"methionine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027methyl\u0027 + \u0027thio-\u0027 + (euphonic) \u0027-n-\u0027 {{suffix||ine|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lipotropic, sulphur-containing essential amino acid, C\u0026lt;sub\u0026gt;5\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;11\u0026lt;/sub\u0026gt;NO\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;S, found in most protein\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027Genome\u0027, Harper Perennial 2004, p. 253\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The purpose was to make soya beans more healthy for those for whom they are a staple food by correcting soya beans\u0027 natural deficiency in a chemical called \u0027\u0027methionine\", \"priority\":3}]}, \"synonyms\":{}}");

	add("methitural", "{\"term\":\"methitural\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A barbiturate derivative used as an ultra-short-acting intravenous anesthetic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("method", "{\"term\":\"method\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|méthode}}, from Ancient greek (to 1453) {{m|grc|μέθοδος||pursuit of knowledge, investigation, mode of prosecuting such inquiry, system}}, from {{affix|grc|μετά|gloss1\u003dafter|ὁδός|gloss2\u003dway, motion, journey|nocat\u003d1}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A process by which a task is completed; a way of doing something (followed by the adposition of, to or for before the purpose of the process\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dOne saint\u0027s day in mid-term a certain newly appointed suffragan-bishop came to the school chapel, and there preached on “The Inner Life.”\u0026amp;nbsp; He at once secured attention by his informal \u0027\u0027method\u0027\u0027, and when presently the coughing of Jarvis […] interrupted the sermon, he altogether captivated his audience with a remark about cough lozenges being cheap and easily procurable\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dEarless ghost swift moths become “invisible” to echolocating bats by forming mating clusters closeabove vegetation and effectively blending into the clutter of echoes that the bat receives from the leaves and stems around them. Many insects probably use this strategy, which is a close analogy to crypsis in the visible world—camouflage and other \u0027\u0027methods\u0027\u0027 for blending into one’s visual background\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A type of theatrical acting wherein the actor utilizes his personal emotions from personal experience to portray a scripted scene\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A subroutine or function belonging to a class or object\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Marijuana\", \"priority\":6}]}, \"synonyms\":{}}");

	add("methodism", "{\"term\":\"methodism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|method|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Methodist Christian movement founded by w:John John Wesley in 18th-century England\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of several related movements\", \"priority\":2}]}, \"synonyms\":{}}");

	add("methodist", "{\"term\":\"methodist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of the Methodist Church; a Wesleyan\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methodology", "{\"term\":\"methodology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027méthodologie\u0027 Surface etymology is \u0027method\u0027 + \u0027-ology\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of methods used in a field\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A collection of methods, practices, procedures and rules used by those who work in some field\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The implementation of such methods etc\", \"priority\":3}]}, \"synonyms\":{}}");

	add("methohexital", "{\"term\":\"methohexital\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A barbiturate-derived drug used as an anesthetic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methotrexate", "{\"term\":\"methotrexate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An antimetabolite and antifolate drug used in treatment of cancer and autoimmune diseases\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methoxsalen", "{\"term\":\"methoxsalen\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A furanocoumarin drug used to treat psoriasis, eczema, vitiligo, and some cutaneous lymphomas in conjunction with exposing the skin to sunlight\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methyl", "{\"term\":\"methyl\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From the German \u0027methyl\u0027 compare the French \u0027méthyle\u0027 French chemists w:Jean-Baptiste Dumas|Jean-Baptiste Dumas and w:Eugene Peligot|Eugene Peligot, after determining w:methanol|methanol\u0027s chemical structure, introduced \u0026quot;methylene\u0026quot; from the Ancient greek (to 1453) \u0027μέθυ\u0027 (wine) + \u0027ὕλη\u0027 (wood (patch of trees)) with the intention of highlighting its origins, \u0026quot;w:alcohol|alcohol made from wood (substance)\u0026quot;, but with Greek language errors: the Greek for \u0026quot;wood (substance)\u0026quot; is \u0027xylo-\u0027 (Ancient greek (to 1453) \u0027ξύλον\u0027 (wood) . The term \u0026quot;methyl\u0026quot; was derived in about 1840 by w:back-formation|back-formation from \u0026quot;methylene\u0026quot;, and was then applied to describe \u0026quot;methyl alcohol\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The univalent hydrocarbon radical, CH\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;, formally derived from methane by the loss of a hydrogen atom; a compound or part of a compound formed by the attachment of such a radical\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, Robert E. Cornish, \u0027Vitamin and Mineral Deficiencies\u0027, [http://books.google.com.au/books?id\u003d8NwpTd77kpcC\u0026amp;pg\u003dPA119\u0026amp;dq\u003d%22methyls%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVLHKUuSkOYaBlQWuoICYCg\u0026amp;ved\u003d0CHIQ6AEwD\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22methyls%22\u0026amp;f\u003dfalse page 119\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"You might point out in the theory of oxidation of oils, in development of rancidity in oils, that many \u0027\u0027methyls\u0027\u0027 accelerate this oxidation of oils. I do not want to burden you with a lecture on chemistry but there are some \u0027\u0027methyls\u0027\u0027 like iron which has both a valence of two and of three. Another example is cobalt which has a valence of both two and three\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Russell Timkovich, \u002773: The Family of d-Type Hemes: Tetrapyrroles with Unusual Substituents\u0027, Karl M. Kadish, Kevin M. Smith, Roger Guilard (editors), \u0027The Porphyrin Handbook\u0027, Volume 12: The Iron and Cobalt Pigments: Biosynthesis, Structure and Degradation, [http://books.google.com.au/books?id\u003dKSRqZharN7MC\u0026amp;pg\u003dPA134\u0026amp;dq\u003d%22methyls%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVLHKUuSkOYaBlQWuoICYCg\u0026amp;ved\u003d0CHgQ6AEwD\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22methyls%22\u0026amp;f\u003dfalse page 134\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The southern acetates must be decarboxylated to \u0027\u0027methyls\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Bruce A. Hathaway, \u0027Organic Chemistry the Easy Way\u0027, [http://books.google.com.au/books?id\u003dfjy2oJuJ_0kC\u0026amp;pg\u003dPA38\u0026amp;dq\u003d%22methyls%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVLHKUuSkOYaBlQWuoICYCg\u0026amp;ved\u003d0CDQQ6AEwA\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22methyls%22\u0026amp;f\u003dfalse page 38\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The most stable form has the groups staggered and the \u0027\u0027methyls\u0027\u0027 as far from each other as possible (DA\u0026lt;sup\u0026gt;[dihedral angle]\u0026lt;/sup\u0026gt; \u003d 180°\", \"priority\":10}]}, \"synonyms\":{}}");

	add("methylation", "{\"term\":\"methylation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|lang\u003den|methyl|ation}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The addition of a methyl group to a molecule\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The addition of a methyl group to cytosine and adenine residues in DNA that leads to the epigenetic modification of DNA and the reduction of gene expression and protein production\", \"priority\":2}]}, \"synonyms\":{}}");

	add("methyldihydromorphine", "{\"term\":\"methyldihydromorphine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|methyl|di-|hydro-|morphine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A semisynthetic opioid drug related to heterocodeine\", \"priority\":1}]}, \"synonyms\":{}}");

