	add("methylenedioxyamphetamine", "{\"term\":\"methylenedioxyamphetamine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a psychedelic and entactogenic drug of the phenethylamine and amphetamine chemical classes\", \"priority\":1}]}, \"synonyms\":{}}");

