	add("methylergometrine", "{\"term\":\"methylergometrine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|methyl|ergometrine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A synthetic analogue of ergonovine with oxytocic properties\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylethylketone", "{\"term\":\"methylethylketone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Abbreviated as\u0027: MEK\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"butanone (especially when used as a solvent\", \"priority\":2}]}, \"synonyms\":{}}");

	add("methylglyoxal", "{\"term\":\"methylglyoxal\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|methyl|glyoxal|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The aldehyde form of pyruvic acid\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylguanosine", "{\"term\":\"methylguanosine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|methyl|guanosine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A methyl derivative of guanosine that is added to the \u0026quot;front\u0026quot; end of a eukaryotic messenger RNA shortly after the start of transcription\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylhydrazine", "{\"term\":\"methylhydrazine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|methyl|hydrazine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hydrazine with an additional methyl group\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylisocyanate", "{\"term\":\"methylisocyanate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|methyl|isocyanate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A toxic organic compound with molecular formula CH\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;NCO, an intermediate in the production of carbamate pesticides\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylisocyanide", "{\"term\":\"methylisocyanide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|methyl|isocyanide|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organic compound of the isocyanide family, mainly used for making five-membered heterocyclic rings\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylnitronitrosoguanidine", "{\"term\":\"methylnitronitrosoguanidine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A biochemical substance used experimentally as a carcinogen and mutagen. It acts by adding alkyl groups to the O\u0026lt;sup\u0026gt;6\u0026lt;/sup\u0026gt; of guanine and O\u0026lt;sup\u0026gt;4\u0026lt;/sup\u0026gt; of thymine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylomics", "{\"term\":\"methylomics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the methylome\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylotrophy", "{\"term\":\"methylotrophy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being methylotrophic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylperone", "{\"term\":\"methylperone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Melperone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylphenidate", "{\"term\":\"methylphenidate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stimulant used to treat attention deficit hyperactivity disorder and narcolepsy, better known by the trade name Ritalin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylphenobarbital", "{\"term\":\"methylphenobarbital\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A barbiturate drug used as a sedative, anxiolytic, and anticonvulsant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylpropene", "{\"term\":\"methylpropene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"IUPAC name for isobutylene\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylscopolamine", "{\"term\":\"methylscopolamine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|methyl|scopolamine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A methylated derivative of scopolamine, used (usually as the bromide salt) as an oral medication to treat peptic ulcers, stomach or intestinal spasms, excessive salivation, and motion sickness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methyltetrahydrofolate", "{\"term\":\"methyltetrahydrofolate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|methyl|tetrahydrofolate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tetrahydrofolate with a methyl substituent, a key natural form of folate. The chief form is 5-methyltetrahydrofolate\", \"priority\":1}]}, \"synonyms\":{}}");

	add("methylxanthine", "{\"term\":\"methylxanthine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|methyl|xanthine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a group of compounds formed through the methylation of xanthines, such as caffeine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metiamide", "{\"term\":\"metiamide\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An H2-receptor antagonist developed from burimamide, an intermediate compound in the development of the successful antiulcer drug cimetidine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("meticulosity", "{\"term\":\"meticulosity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Meticulousness; the state or quality of being meticulous\", \"priority\":1}]}, \"synonyms\":{}}");

	add("meticulousness", "{\"term\":\"meticulousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or characteristic of being meticulous\", \"priority\":1}]}, \"synonyms\":{}}");

	add("métier", "{\"term\":\"métier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|métier|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any activity that is pursued as a trade or profession; a callin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An activity to which a person is particularly suited; a forte\", \"priority\":2}]}, \"synonyms\":{}}");

	add("metipranolol", "{\"term\":\"metipranolol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A non-selective beta blocker used in eyedrops to treat glaucoma\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metirosine", "{\"term\":\"metirosine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Shortening of \u0027methyltyrosine\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An antihypertensive drug that inhibits tyrosine hydroxylase\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metonym", "{\"term\":\"metonym\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{back-form|metonymy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word that names an object from a single characteristic of it or of a closely related object; a word used in metonymy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Calling the monarch \u0026quot;your majesty\u0026quot; is using a \u0027\u0027metonym\", \"priority\":2}]}, \"synonyms\":{}}");

	add("metope", "{\"term\":\"metope\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027metopa\u0027 and its source, Hellenistic Greek \u0027μετόπη\u0027 from Ancient greek (to 1453) \u0027μετά\u0027 (meta-) + \u0027ὀπή\u0027 (hole)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The architectural element between two triglyphs in a Doric frieze\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Russell Hoban, \u0027Fremder\u0027, Bloomsbury 2003, p. 117\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There\u0027s a second plate of that \u0027\u0027metope\u0027\u0027 that shows the full figures of both Perseus and Medusa and includes the winged horse Pegasus that was born of Medusa\u0027s blood\", \"priority\":3}]}, \"synonyms\":{}}");

	add("metopomancy", "{\"term\":\"metopomancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027métopomantie\u0027 (from Ancient greek (to 1453) \u0027μέτωπον\u0027 (forehead) , later reformed after {{suffix||mancy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Divination by interpreting the facial lines and wrinkles, especially the forehead\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Religion and the Decline of Magic\u0027, Folio Society (2012), page 231\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"These elaborate systems of divination, with their subdivisions, such as divination by moles on the face, or lines on the forehead (\u0027\u0027metopomancy\u0027\u0027), had been set out in many medieval treatises […\", \"priority\":3}]}, \"synonyms\":{}}");

	add("metopon", "{\"term\":\"metopon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An opiate analogue, a methylated derivative of hydromorphone used as an analgesic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metramorphosis", "{\"term\":\"metramorphosis\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\"], \"text\":\"Coined by {{w|Bracha L. Ettinger}}. See \u0027metrium\u0027 (womb) and \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A creative principle supposed to be responsible for changes in borderlines\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Pat Paxson, \u0027Art and Intuition: Borderlines and Boundaries\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The third element of the matrixial model is \u0027\u0027\u0027metramorphosis\u0027\u0027\u0027: a process of change that is a result of nonphallic ways of contacting the archaic m/Other\", \"priority\":3}]}, \"synonyms\":{}}");

	add("metricization", "{\"term\":\"metricization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|metric|ize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the process introducing metrics to a process or field\", \"priority\":1}]}, \"synonyms\":{}}");

