	add("metrology", "{\"term\":\"metrology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027μέτρον\u0027 (measure) + -logy.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The science of weights and measures or of measurement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A system of weights and measures\", \"priority\":2}]}, \"synonyms\":{}}");

