	add("metronome", "{\"term\":\"metronome\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Coined in English from Ancient greek (to 1453) {{m|grc|μέτρον||measure}} + {{m|grc|νόμος||regulation, law}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a device, containing an inverted pendulum, used to mark time by means of regular ticks at adjustable intervals; an electronic equivalent that emits flashes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("metronym", "{\"term\":\"metronym\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From μήτηρ|meter \u0026quot;mother\u0026quot; + -onym \u0026quot;name\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The name of someone\u0027s mother\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A matronymic surname\", \"priority\":2}]}, \"synonyms\":{}}");

