	add("metropole", "{\"term\":\"metropole\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027metropole\u0027 (town with bishop\u0027s seat) from Latin {{m|la|mētropolis}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A metropolis; the main city of a country or area\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The parent-state of a colony\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Bruce Ackerman, ‘Meritocracy v. Democracy’, \u0027London Review of Books\u0027 29:5, p. 9\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Though the \u0027\u0027metropole\u0027\u0027 remained confident in its Westminster ways, its newly independent colonies imposed constitutional constraints on the powers of parliament\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, John Darwin, \u0027After Tamerlane\u0027, Penguin 2008, p. 63\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"As Europe\u0027s population growth and commercial activity slowed down after 1620, its thirst for Spanish-American silver slackened: \u0027\u0027metropole\u0027\u0027 and colony were drifting apart\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A bishop\u0027s see\", \"priority\":7}]}, \"synonyms\":{}}");

	add("metropoleis", "{\"term\":\"metropoleis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In the sense of chief cities of colonies, especially in ancient Greece\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, I M Drakonoff, \u0027Early Antiquity\u0027, p36\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We have already mentioned that some colonies eventually became \u0027\u0027metropoleis\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Alan K. Bowman, \u0027The Cambridge Ancient History\u0027, p68\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The role which the \u0027\u0027metropoleis\u0027\u0027 developed as administrative centres for their nomes had always been inherent in the Ptolomeic system but the evidence suggests that it was much enhanced under the Romans\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Jane Rowlandson, \u0027Women and Society in Greek and Roman Egypt\u0027, p1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The larger \u0027\u0027metropoleis\u0027\u0027 were sizeable communities: Hermopolis had perhaps as many as 40,000 inhabitants, Oxyrhynchos maybe around 25,000\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In the sense of any large, busy city, especially as the main city in an area or country or as distinguished from surrounding rural areas\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, University of Texas at Austin, Southwestern Political and Social Science Association, \u0027Social Science Quarterly\u0027, p2\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Like bees to their hives, increasing numbers of Americans swarm into \u0027\u0027metropoleis\u0027\u0027.\u0026lt;sup\u0026gt;2\u0026lt;/sup\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, George M. Smerk, \u0027Readings in Urban Transportation\u0027, p17\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Our census takers, population experts, sociologists, economists and urban planners all point to the bigger and better \u0027\u0027“metropoleis”\u0027\u0027 (to use the accepted plural) of the future\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, ABIN Update: The Newsletter of the American Bundestag Intern Network, \u0027Volume 9, Issue 1 (Fall Edition), 2003 — “Metrosexual Beyond Borders”\u0027, p\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The pop-culture term, “metrosexual”, coined in 1994 by author, Mark Simpson, meaning “a dandyish narcissist in love with not only himself, but also his urban lifestyle; a straight man who is in touch with his feminine side” (wordspy.com), is spouted with increasing frequency on the streets of America’s \u0027\u0027metropoleis\", \"priority\":14}]}, \"synonyms\":{}}");

	add("metropolis", "{\"term\":\"metropolis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\"], \"text\":\"First attested in Middle english (1100-1500) from {{m|la|mētropolis}}, from Ancient greek (to 1453) \u0027μητρόπολις\u0027 (mother city) from \u0027μήτηρ\u0027 (mother) + \u0027πόλις\u0027 (city (state)) \u0026lt;ref name\u003d\u0026quot;COED-etym\u0026amp;pron\u0026quot;\u0026gt;The \u0027\u0027Concise Oxford English Dictionary\u0027\u0027 [Eleventh Edition]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The mother (founding) polis (city state) of a colony, especially in the Ancient Greek/Hellenistic world\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large, busy city, especially as the main city in an area or country or as distinguished from surrounding rural areas\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The see of a metropolitan archbishop, ranking above its suffragan diocesan bishops\", \"priority\":3}]}, \"synonyms\":{}}");

	add("metropolitan", "{\"term\":\"metropolitan\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027metropolitanus\u0027 from Ancient greek (to 1453) \u0027μητροπολίτης\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bishop empowered to oversee other bishops; an archbishop\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 514\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Yet from the late thirteenth century the \u0027\u0027metropolitan\u0027\u0027 based himself either in Moscow or Vladimir-on-the-Kliazma, which was also in Muscovite territory, and it became the ambition of the Muscovites to make this arrangement permanent\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The inhabitant of a metropolis\", \"priority\":4}]}, \"synonyms\":{}}");

